// Professional InsightFlow — Enterprise Design (Plain CSS + React)
// Put this in: src/App.jsx
// Companion CSS: src/App.css (included at bottom of this document)

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import Sidebar from './components/Sidebar';
import Home from './components/Home';
import AnalysisPage from './components/AnalysisPage';
import './App.css';

export default function App() {
  return (
    <Router>
      <div className="pf-app">
        <Header />
        <div className="pf-body">
          <Sidebar />
          <main className="pf-main">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/:analysisType" element={<AnalysisPage />} />
            </Routes>
          </main>
        </div>
        <footer className="pf-footer">© {new Date().getFullYear()} InsightFlow — All rights reserved</footer>
      </div>
    </Router>
  );
}

/* ---------------------------
   Below are component files
   Save these under src/components/
   --------------------------- */

/* Header.jsx */
export function HeaderComponent() {
  return (
    <header className="pf-header">
      <div className="pf-container pf-header-inner">
        <div className="pf-brand">
          <img src="/logo.png" alt="InsightFlow" className="pf-logo" />
          <div className="pf-brand-text">
            <div className="pf-title">InsightFlow</div>
            <div className="pf-sub">Enterprise Analytics</div>
          </div>
        </div>
        <div className="pf-controls">
          <input className="pf-search" placeholder="Search analyses, datasets..." />
          <button className="pf-ghost">Docs</button>
          <button className="pf-primary">Sign in</button>
        </div>
      </div>
    </header>
  );
}

/* Sidebar.jsx */
export function SidebarComponent() {
  return (
    <aside className="pf-sidebar">
      <nav>
        <ul>
          <li><a href="/">Dashboard</a></li>
          <li><a href="/energy-analysis">Energy Analysis</a></li>
          <li><a href="/stock-analysis">Stock Analysis</a></li>
          <li><a href="/attendance-analysis">Attendance Analysis</a></li>
          <li className="pf-sep">Integrations</li>
          <li><a href="#">Settings</a></li>
          <li><a href="#">Help</a></li>
        </ul>
      </nav>
      <div className="pf-compact-cta">
        <div className="pf-cta-title">Pro features</div>
        <div className="pf-cta-text">Export scheduled reports & team sharing</div>
        <button className="pf-primary pf-block">Upgrade</button>
      </div>
    </aside>
  );
}

/* Home.jsx */
import { useNavigate } from 'react-router-dom';
export function HomeComponent() {
  const navigate = useNavigate();
  const ANALYSES = [
    { id: 'energy-analysis', label: 'Energy Data Analysis' },
    { id: 'stock-analysis', label: 'Stock Data Analysis' },
    { id: 'attendance-analysis', label: 'School Attendance Analysis' },
  ];

  return (
    <div className="pf-page">
      <div className="pf-hero">
        <div className="pf-hero-left">
          <h1>InsightFlow — Professional Analytics</h1>
          <p className="pf-lead">A secure, enterprise-ready analytics platform for teams. Upload data, run analyses, and export formal reports with one click.</p>
          <div className="pf-hero-actions">
            <select className="pf-select" defaultValue="" onChange={(e) => e.target.value && navigate(`/${e.target.value}`)}>
              <option value="">Select analysis</option>
              {ANALYSES.map(a => <option key={a.id} value={a.id}>{a.label}</option>)}
            </select>
            <button className="pf-outlined" onClick={() => navigate('/energy-analysis')}>Try sample data</button>
          </div>
        </div>
        <div className="pf-hero-right">
          <div className="pf-card pf-stats">
            <div className="pf-stat">Uploads <strong>1,245</strong></div>
            <div className="pf-stat">Analyses <strong>842</strong></div>
            <div className="pf-stat">Avg. run <strong>7s</strong></div>
          </div>
        </div>
      </div>

      <section className="pf-features">
        <article className="pf-feature-card">
          <h3>Secure by design</h3>
          <p>Role-based access control, SSO-ready, and encrypted storage.</p>
        </article>
        <article className="pf-feature-card">
          <h3>Shareable reports</h3>
          <p>Export PDF or schedule automated email reports for stakeholders.</p>
        </article>
        <article className="pf-feature-card">
          <h3>AI-driven insights</h3>
          <p>Auto-detect anomalies and get suggested actions.</p>
        </article>
      </section>
    </div>
  );
}

/* AnalysisPage.jsx */
import { useParams } from 'react-router-dom';
import { useState } from 'react';
export function AnalysisPageComponent() {
  const { analysisType } = useParams();
  const [columns, setColumns] = useState([]);

  const onFakeUpload = () => {
    // demo: set sample columns
    setColumns(['Date', 'Metric', 'Region', 'Category']);
  };

  return (
    <div className="pf-page">
      <div className="pf-grid">
        <div className="pf-col-main">
          <div className="pf-card">
            <h2>{analysisType ? analysisType.replace('-', ' ') : 'Analysis'}</h2>
            <p className="pf-muted">Upload a dataset to run this analysis. For demo, click the sample button.</p>
            <div className="pf-upload">
              <input type="file" />
              <button className="pf-primary" onClick={onFakeUpload}>Upload & analyze</button>
            </div>

            {columns.length > 0 && (
              <div className="pf-panel">
                <h4>Detected columns</h4>
                <div className="pf-tags">{columns.map(c => <span key={c} className="pf-tag">{c}</span>)}</div>
              </div>
            )}

            <div className="pf-results">
              <div className="pf-placeholder">Charts and results will appear here (integrate Chart.js or Recharts)</div>
            </div>
          </div>
        </div>

        <aside className="pf-col-side">
          <div className="pf-card">
            <h4>Summary</h4>
            <p className="pf-muted">Export, share, or schedule this report.</p>
            <button className="pf-outlined pf-block">Export PDF</button>
          </div>

          <div className="pf-card">
            <h4>Actions</h4>
            <button className="pf-ghost">Download CSV</button>
            <button className="pf-ghost">Schedule report</button>
          </div>
        </aside>
      </div>
    </div>
  );
}

/* -------------------------------------------------------------------
   NOTE: For the canvas convenience, the components are included above as
   named exports. When copying into your project create real files:
   - src/components/Header.jsx (export default HeaderComponent)
   - src/components/Sidebar.jsx (export default SidebarComponent)
   - src/components/Home.jsx (export default HomeComponent)
   - src/components/AnalysisPage.jsx (export default AnalysisPageComponent)

   Below is the plain CSS to place in src/App.css
   ------------------------------------------------------------------- */
